import React, { useContext, useEffect, useState } from 'react';
import { Modal, Dropdown, Button } from 'react-bootstrap';
import axios from 'axios';
import { Context } from '../..';

const GetResults = ({ show, onHide }) => {
  const [results, setResults] = useState([]);
  const { device } = useContext(Context);

  const addInfo = () => {
    setInfo([...info, {title: '', description1: '', description2: '', description3: '', description4: '', number: Date.now()}])
  }
    const removeInfo = (number) => {
      setInfo(info.filter(i => i.number !== number))
  }
  const changeInfo = (key, value, number) => {
      setInfo(info.map(i => i.number === number ? {...i, [key]: value} : i))
  }

  useEffect(() => {
    let integer = device.selectedDevice.id
    axios.get(`${process.env.REACT_APP_API_URL}api/testResult/${integer}`)
      .then(response => {
        setResults(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the survey results!', error);
      });
  }, [device.devices]); // Добавляем зависимость от device.devices

  const getResult = () => {
    console.log(results);//Тута надо что-то делать!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
  };

  return (
    <Modal
      show={show}
      onHide={onHide}
      centered
    >
      <h2>Survey Results</h2>
      <Dropdown className="mt-2 mb-2">
        <Dropdown.Toggle>{device.selectedDevice.name || "Выберите опрос"}</Dropdown.Toggle>
        <Dropdown.Menu>
          {Array.isArray(device.devices) && device.devices.map(deviceItem =>
            <Dropdown.Item
              onClick={() => device.setSelectedDevice(deviceItem)}
              key={deviceItem.id}
            >
              {deviceItem.name}
            </Dropdown.Item>
          )}
        </Dropdown.Menu>
      </Dropdown>
      <Modal.Footer>
        <Button variant="outline-danger" onClick={onHide}>Закрыть</Button>
        <Button variant="outline-success" onClick={getResult}>Посмотреть</Button>
      </Modal.Footer>
      {info.map(i =>
        <Col className="mt-4" key={i.number}>
            <Col className="mt-2 mb-2">
                <Dropdown className="mt-2 mb-2">
                    <Dropdown.Toggle>{i.count || "Выберите тип"}</Dropdown.Toggle>
                    <Dropdown.Menu>
                    {device.counts.map(count => 
                            <Dropdown.Item
                            onClick={(e) => {
                                device.setSelectedCount(count);
                                changeInfo('count', count.name, i.number);
                              }}
                            
                                key={i.count}
                            >
                            {count.name}
                            </Dropdown.Item>
                    )}
                    </Dropdown.Menu>
                </Dropdown>
            </Col>
            <Col className="mt-2 mb-2">
            <Form.Control
                    value={i.title}
                    onChange={(e) => changeInfo('title', e.target.value, i.number)}
                    placeholder="Введите вопрос"
                />
            </Col>
            <Col className="mt-2 mb-2">
                <Form.Control
                    value={i.description1}
                    onChange={(e) => changeInfo('description1', e.target.value, i.number)}
                    placeholder="Введите варинты ответа(4)"
                />
            </Col>
            <Col className="mt-2 mb-2">
                <Form.Control
                    value={i.description2}
                    onChange={(e) => changeInfo('description2', e.target.value, i.number)}
                    placeholder="Введите варинты ответа(4)"
                />
            </Col>
            <Col className="mt-2 mb-2">
                <Form.Control
                    value={i.description3}
                    onChange={(e) => changeInfo('description3', e.target.value, i.number)}
                    placeholder="Введите варинты ответа(4)"
                />
            </Col>
            <Col className="mt-2 mb-2">
                <Form.Control
                    value={i.description4}
                    onChange={(e) => changeInfo('description4', e.target.value, i.number)}
                    placeholder="Введите варинты ответа(4)"
                />
            </Col>
            <Form.Control as="select" className="mt-2 mb-2">
            <option value="">Выберите правильный ответ</option>
                <option value="description1">Ответ 1</option>
                <option value="description2">Ответ 2</option>
                <option value="description3">Ответ 3</option>
                <option value="description4">Ответ 4</option>
            </Form.Control>
            <Col className="mt-2 mb-2">
                <Button
                    onClick={() => removeInfo(i.number)}
                    variant={"outline-danger"}
                >
                    Удалить
                </Button>
            </Col>
        </Col>
    )}
    </Modal>
  );
};

export default GetResults;
